const initState = [
    { city: "Madrid", country: "Spain" },
    { city: "Barcelona", country: "Spain" },
    { city: "NYC", country: "USA" },
    { city: "Los Angeles", country: "USA" },
    { city: "Paris", country: "France" }
  ];

  const data = (state = initState) => {
    return state;
  };

  export default data;
